import React from 'react';

const Items = ({ isPacked, name }) => {
  const tickSymbol = '✔'; // Ký hiệu đánh dấu "đã đóng gói"
  return (
    <li className={isPacked ? 'text-red-500' : ''}>
      {isPacked ? name + tickSymbol : name}
    </li>
  );
}

export default Items;
